// App.js

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCalendarCheck, faAngleUp } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";
import Doctor from "./path/to/your/doctor-image.jpg"; // Replace with the correct path

function App() {
  // Define handleBookAppointmentClick and scrollToTop functions if not already defined

  // Define handleBookAppointmentClick function
  const handleBookAppointmentClick = () => {
    // Implement the logic for handling appointment bookings
    console.log("Book Appointment clicked");
    // Add your logic here, such as opening a modal or navigating to a booking page
  };

  // Define scrollToTop function
  const scrollToTop = () => {
    // Implement the logic to scroll to the top of the page
    window.scrollTo({
      top: 0,
      behavior: "smooth",
    });
  };
  const goUp = true; 
  return (
    <>
      <h1 style={{ textAlign: "center" }}>WELCOME</h1>
      <div className="container">
        {/* doctor */}
        <div className="doctor">
          <div
            className="img"
            style={{
              backgroundImage:
                "url('https://b.kisscc0.com/20180705/bqe/kisscc0-physician-doctor-of-medicine-computer-icons-downlo-doctor-5b3e48c8bdada8.2417379115308085207769.png')",
            }}
          ></div>
          <p>doctor</p>
          <div className="button">
            <Link to="/Doctorlogin">
              <button id="login-btn" className="signin">
                Login
              </button>
            </Link>
          </div>
        </div>
        {/* patient */}
        <div className="patient">
          <div
            className="img"
            style={{
              backgroundImage:
                "url('https://clipart-library.com/data_images/12685.png')",
            }}
          ></div>
          <p>patient</p>
          <div className="button">
            <Link to="/UserLogin">
              <button id="login-btn" className="signin">
                Login
              </button>
            </Link>
          </div>
        </div>
        {/* office-executive*/}
        <div className="office-executive">
          <div
            className="img"
            style={{
              backgroundImage:
                "url('https://cdn4.iconfinder.com/data/icons/VISTA/business/png/400/receptionist.png')",
            }}
          ></div>
          <p>office-executive</p>
          <div className="button">
            <Link to="/FofficeLogin">
              <button id="login-btn" className="signin">
                Login
              </button>
            </Link>
          </div>
        </div>
        {/* pharmacist */}
        <div className="pharmacist">
          <div
            className="img"
            style={{
              backgroundImage:
                "url('https://icons.iconarchive.com/icons/icons-land/vista-people/256/Medical-Pharmacist-Male-Light-icon.png')",
            }}
          ></div>
          <p>pharmacist</p>
          <div className="button">
            <Link to="/PharmacistLogin">
              <button id="login-btn" className="signin">
                Login
              </button>
            </Link>
          </div>
        </div>
      </div>

      <div
        style={{
          backgroundColor: "#f0f0f0",
          padding: "20px",
          textAlign: "center",
        }}
      >
        <h2>Welcome to Our Healthcare System</h2>
        <div className="section-container">
          <div className="hero-section">
            <div className="text-section">
              <p className="text-headline">❤️ Health comes first</p>
              <h2 className="text-title">
                Find your Doctor and make an Appointments
              </h2>
              <p className="text-descritpion">
                Talk to online doctors and get medical advice, online prescriptions,
                refills and medical notes within minutes. On-demand healthcare
                services at your fingertips.
              </p>
              <button
                className="text-appointment-btn"
                type="button"
                onClick={handleBookAppointmentClick}
              >
                <FontAwesomeIcon icon={faCalendarCheck} /> Book Appointment
              </button>
              <div className="text-stats">
                <div className="text-stats-container">
                  <p>145k+</p>
                  <p>Receive Patients</p>
                </div>

                <div className="text-stats-container">
                  <p>50+</p>
                  <p>Expert Doctors</p>
                </div>

                <div className="text-stats-container">
                  <p>10+</p>
                  <p>Years of Experience</p>
                </div>
              </div>
            </div>

            <div className="hero-image-section">
              <img className="hero-image1" src={Doctor} alt="Doctor" />
            </div>
          </div>

          <div
            onClick={scrollToTop}
            className={`scroll-up ${goUp ? "show-scroll" : ""}`}
          >
            <FontAwesomeIcon icon={faAngleUp} />
          </div>
        </div>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam
          consectetur, libero ut rhoncus eleifend, nisl justo fringilla arcu,
          eu cursus orci tellus in libero.
        </p>
      </div>
    </>
  );
}

export default App;
